import React, { useState} from 'react';
import Box from '@mui/material/Box';
import AppBar from '@mui/material/AppBar';
import Toolbar from '@mui/material/Toolbar';
import Menu from '@mui/material/Menu';
import MenuItem from '@mui/material/MenuItem';
import ListItemText from '@mui/material/ListItemText';
import LunchDiningIcon from '@mui/icons-material/LunchDining';
import NotificationsPausedIcon from '@mui/icons-material/NotificationsPaused';
import Button from '@mui/material/Button';


function MenuMUI2 () {


 const [anchorFood, setOpenFood] = useState(null);


  const handleFoodOpen = (event) => {
    setOpenFood(event.currentTarget);
  };


 const foodOpen = (e) => {
  setOpenFood(e.currentTarget );
 };


const foodClose = () => {
  setOpenFood(null);
}
  


const food =
<Menu 
  anchorEl={ anchorFood }
  open={ Boolean(anchorFood) }
  onClose={menuClose}
  onMouseLeave={menuClose}
>
  <MenuItem onClick={ menuClose }>
    <ListItemText primary='Ruokalista' />
  </MenuItem>
  <MenuItem onClick={ menuClose }>
    <ListItemText primary='Lisää ruoka' />
    </MenuItem>
    
</Menu>;



  return (
    <Box>
      <AppBar sx={{backgroundColor: '#45484e',color: '#FAD22B' }} position='static'>
        <Toolbar >

          <Button onMouseEnter={handleFoodOpen} variant="outlined" color='inherit'><LunchDiningIcon /> Ruoka</Button>
          { food }
          
        </Toolbar>
      </AppBar>
    </Box>
  );
}

export default  MenuMUI2;
